      carddesc_1047: ".\u0623\u062c\u0639\u0644 \u0627\u0644\u0628\u0634\u0631 \u0644\u0627 \u064a\u0639\u0631\u0641\u0648\u0646 \u0627\u0644\u0645\u0648\u062a \u060c \u0623\u0636\u0639 \u0627\u0644\u0623\u0645\u0644 \u0627\u0644\u0623\u0639\u0645\u0649 \u0641\u064a \u0642\u0644\u0648\u0628\u0647\u0645. \u0627\u0644\u0649 \u062c\u0627\u0646\u0628 \u0630\u0644\u0643 \u060c \u0623\u0639\u0637\u064a\u062a\u0647\u0645 \u0627\u0644\u0646\u0627\u0631.",
      carddesc_1048: "\u0644\u0642\u062f \u0643\u0646\u062a \u0623\u0646\u0627\u0645 \u0645\u0646\u0630 \u0622\u0644\u0627\u0641 \u0627\u0644\u0633\u0646\u064a\u0646. \u0645\u0646 \u062e\u0644\u0642\u0646\u064a\u061f",
      carddesc_1049: "\u0644\u0645\u0627\u0630\u0627 \u064a\u0639\u062a\u0628\u0631\u0646\u064a \u0627\u0644\u0646\u0627\u0633 \u0623\u0645\u0631\u064b\u0627 \u0645\u0634\u0624\u0648\u0645\u064b\u0627\u061f",
      carddesc_1050: "\u0627\u0644\u0623\u0645\u064a\u0631\u0629 \u0627\u0644\u0639\u0632\u064a\u0632\u0629 \u060c \u0625\u0630\u0627 \u0642\u0628\u0644\u062a\u0646\u064a \u060c \u0633\u062a\u0634\u0647\u062f \u0627\u0644\u0633\u062d\u0631!",
      carddesc_1051: "\u0631\u0627\u0626\u0639! \u0643\u0645 \u0647\u064a \u062c\u0645\u064a\u0644\u0629 \u0627\u0644\u062a\u0641\u0627\u062d \u0627\u0644\u0623\u062d\u0645\u0631! \u064a\u062c\u0628 \u0623\u0646 \u062a\u0643\u0648\u0646 \u0644\u0630\u064a\u0630\u0629. \u0634\u0643\u0631\u0627 \u0644\u0643!",
      carddesc_1052: "\u0633\u0623\u0636\u0639 \u0627\u0644\u0647\u062f\u0627\u064a\u0627 \u0641\u064a \u062c\u0648\u0627\u0631\u0628 \u0639\u064a\u062f \u0627\u0644\u0645\u064a\u0644\u0627\u062f \u0627\u0644\u062e\u0627\u0635\u0629 \u0628\u0643. \u0639\u064a\u062f \u0645\u064a\u0644\u0627\u062f \u0645\u062c\u064a\u062f!",
      carddesc_1053: "\u0641\u064a\u0646\u064a\u0643\u0633 \u0646\u064a\u0631\u0641\u0627\u0646\u0627 \u0645\u0648\u0644\u0648\u062f \u0645\u0646 \u0627\u0644\u0646\u0627\u0631!",
      carddesc_1054: "\u0623\u064a\u0647\u0627 \u0627\u0644\u0631\u062c\u0627\u0644 \u060c \u0625\u0630\u0627 \u0643\u0646\u062a\u0645 \u0639\u0644\u0649 \u0627\u0633\u062a\u0639\u062f\u0627\u062f \u0644\u0644\u0642\u062a\u0627\u0644 \u0645\u0646 \u0623\u062c\u0644 \u0634\u0639\u0628\u0646\u0627 \u060c \u0641\u0623\u0646\u0627 \u0623\u0631\u064a\u062f\u0643\u0645!",
      carddesc_1055: "\u0647\u0644 \u064a\u0645\u0643\u0646 \u0623\u0646 \u0623\u0633\u0627\u0639\u062f\u0643\u061f",
      carddesc_1056: "\u0647\u0644 \u0633\u062a\u0646\u0636\u0645 \u0625\u0644\u064a \u0641\u064a \u0627\u0644\u062a\u0646\u0642\u064a\u0628 \u0639\u0646 \u0627\u0644\u0643\u0646\u0632\u061f",
      carddesc_1057: "\u0645\u0627 \u0647\u0648 \u0623\u0639\u0638\u0645 \u0627\u062e\u062a\u0631\u0627\u0639 \u0641\u064a \u062a\u0627\u0631\u064a\u062e \u0627\u0644\u0628\u0634\u0631\u064a\u0629\u061f",
      carddesc_1058: "\u0623\u0648\u0647! \u0623\u0646\u0627 \u062d\u0628\u0629 \u0631\u0645\u0644 \u060c \u062a\u0647\u0628 \u0628\u0627\u062a\u062c\u0627\u0647 \u0627\u0644\u0634\u0631\u0642 \u0645\u0639 \u0627\u0644\u0631\u064a\u062d! \u0627\u0644\u0631\u064a\u062d \u0633\u064a\u062f\u064a. \u0645\u0646 \u0647\u0648 \u0633\u064a\u062f \u0627\u0644\u0631\u064a\u062d\u061f",
      carddesc_1059: ".\u0625\u0630\u0627 \u0643\u0646\u062a \u0645\u062a\u0633\u0627\u0645\u062d\u064b\u0627 \u0648\u062a\u0631\u0649 \u0627\u0644\u063a\u0636\u0628 \u0639\u062f\u0648\u064b\u0627 \u060c \u0641\u064a\u0645\u0643\u0646\u0643 \u0627\u0644\u062a\u0633\u0647\u064a\u0644 \u0639\u0644\u0649 \u0627\u0644\u0645\u062f\u0649 \u0627\u0644\u0637\u0648\u064a\u0644.",
      carddesc_1060: "\u064a\u0639\u062a\u0645\u062f \u0627\u0644\u0645\u0635\u064a\u0631 \u0627\u0644\u062c\u064a\u062f \u0623\u0648 \u0627\u0644\u0633\u064a\u0626 \u0644\u0644\u062d\u064a\u0627\u0629 \u0643\u0644\u064a\u064b\u0627 \u0639\u0644\u0649 \u0642\u062f\u0631 \u0627\u0644\u0645\u0631\u0621 \u0648\u0634\u062c\u0627\u0639\u062a\u0647.",
      carddesc_1061: "\u0628\u062d\u0631 \u0627\u0644\u0645\u0639\u0627\u0646\u0627\u0629 \u0644\u0627 \u062d\u062f\u0648\u062f \u0644\u0647 \u060c \u0648\u0627\u0644\u0634\u0627\u0637\u0626 \u0627\u0644\u0639\u0648\u062f\u0629 \u0625\u0644\u0649 \u0627\u0644\u0648\u0631\u0627\u0621.",
      carddesc_1062: "\u0633\u0648\u0644 \u0633\u0623\u0642\u0627\u062a\u0644 \u0645\u0639\u0643 \u062d\u062a\u0649 \u0627\u0644\u0645\u0648\u062a!",
      carddesc_1063: "\u0644\u0627 \u062a\u0645\u0644 \u0627\u0644\u062c\u0628\u0627\u0644 \u0623\u0628\u062f\u064b\u0627 \u0645\u0646 \u0627\u0644\u0627\u0631\u062a\u0641\u0627\u0639 \u060c \u0648\u0627\u0644\u0628\u062d\u0627\u0631 \u0644\u0627 \u062a\u0645\u0644 \u0623\u0628\u062f\u064b\u0627 \u0645\u0646 \u0627\u0644\u0639\u0645\u0642.",
      carddesc_1064: "\u0645\u0633\u062e! \u0625\u0644\u0649 \u0623\u064a\u0646 \u062a\u0631\u0643\u0636\u061f",
      carddesc_1065: "\u0627\u0644\u062d\u064a\u0627\u0629 \u0645\u062b\u0644 \u0627\u0644\u0633\u0646\u062f\u0627\u0646 \u060c \u0641\u0643\u0644\u0645\u0627 \u062a\u0639\u0631\u0636 \u0644\u0644\u0636\u0631\u0628 \u0623\u0643\u062b\u0631 \u060c \u0643\u0644\u0645\u0627 \u0627\u0646\u0628\u0639\u062b \u0627\u0644\u0645\u0632\u064a\u062f \u0645\u0646 \u0627\u0644\u0634\u0631\u0631!",
      carddesc_1066: "\u0644\u0648\u0643\u064a \u060c \u0623\u0646\u0627 \u0623\u0643\u0631\u0647\u0643 \u0625\u0644\u0649 \u0623\u0642\u0635\u0649 \u0627\u0644\u062d\u062f\u0648\u062f!",
      carddesc_1067: "\u0627\u0644\u0631\u0648\u0645\u0627\u0646\u0633\u064a\u0629 \u0644\u0627 \u062a\u0645\u0648\u062a \u0623\u0628\u062f\u0627.",
      carddesc_1068: "\u0647\u0644 \u0631\u0623\u064a\u062a \u0623\u0631\u0636 \u0627\u0644\u062d\u0631\u064a\u0629 \u0627\u0644\u062a\u064a \u0623\u062a\u062d\u062f\u062b \u0639\u0646\u0647\u0627\u061f",
      carddesc_1069: "\u0645\u0646 \u064a\u0633\u062a\u0637\u064a\u0639 \u0635\u0646\u0639 \u0633\u0644\u0627\u062d \u0623\u0641\u0636\u0644 \u0645\u0646\u064a\u061f",
