      carddesc_1072: "\u0647\u0644 \u062a\u0631\u0649 \u0648\u062c\u0648\u062f\u064a\u061f",
      carddesc_1073: "\u064a\u0645\u0643\u0646\u0646\u064a \u0642\u0628\u0648\u0644 \u0627\u0644\u0641\u0634\u0644 \u060c \u0644\u0643\u0646 \u0644\u0627 \u064a\u0645\u0643\u0646\u0646\u064a \u0642\u0628\u0648\u0644 \u0627\u0644\u0627\u0633\u062a\u0633\u0644\u0627\u0645.",
      carddesc_1074: "\u062f\u0627\u0645\u062a \u0648\u0644\u064a\u0645\u0629 \u0632\u0641\u0627\u0641\u0646\u0627 \u062b\u0644\u0627\u062b\u0629 \u0622\u0644\u0627\u0641 \u0633\u0646\u0629.",
