      newGuide_id106_3: "\u064a\u0645\u0643\u0646\u0643 \u062a\u062e\u0632\u064a\u0646 \u0645\u0627 \u064a\u0635\u0644 \u0625\u0644\u0649 3 \u0635\u0646\u0627\u062f\u064a\u0642. \u0627\u0641\u062a\u062d \u0627\u0644\u0645\u0632\u064a\u062f \u0644\u062a\u062c\u0645\u0639 \u0627\u0644\u0645\u0632\u064a\u062f!",
