      newGuide_id110: "\u062a\u0631\u062a\u064a\u0628 \u0645\u0633\u062a\u0648\u0649 \u0627\u0644\u0628\u0637\u0644 \u0647\u0646\u0627 \u060c \u0648\u0633\u064a\u062a\u0645 \u0625\u0639\u0627\u062f\u0629 \u062a\u0639\u064a\u064a\u0646\u0647 \u0628\u0639\u062f \u0645\u0648\u0633\u0645 \u0648\u0627\u062d\u062f. \u062a\u0639\u0627\u0644 \u0648\u0642\u0645 \u0628\u0627\u0644\u062a\u0631\u0642\u064a\u0629!",
