      carddesc_1001: "Make your offerings. Zeus is here.",
      carddesc_1002: "Fight, my warriors!",
      carddesc_1003: "The only way to stop this war is for you to take your rightful place as king.",
      carddesc_1004: "Look me in the eyes.",
      carddesc_1005: "Don't be naughty, Cupid.",
      carddesc_1006: "Destroy my country, foolish dreams!",
      carddesc_1007: "Guess what's in the hat?",
      carddesc_1008: "Love is the one thing that transcends time and space.",
      carddesc_1009: "Life had never been sweeter.",
      carddesc_1010: "Every woman has a crazy side that only the right man can bring out.",
      carddesc_1011: "Gung hay fat choy!",
      carddesc_1012: "The rest of the treasure is yours, but the lamp is mine.",
      carddesc_1013: "Why have not we an immortal soul?",
      carddesc_1014: "Who turns the gypsy's day from gloom to brightest sunshine?His lovely gypsy maid!",
      carddesc_1015: "I want you to love me,and let me be your companion.",
      carddesc_1016: "Hear me roar!",
      carddesc_1017: "I'm a panda.",
      carddesc_1018: "The change of seasons, migration instincts.",
      carddesc_1019: "Wake up, my people!",
      carddesc_1020: "Do you want to fly?",
      carddesc_1021: "I will escort the lord to arrive safely!",
      carddesc_1022: "It was me, the author of all your pain.",
      carddesc_1023: "Come and drink with me.",
      carddesc_1024: "For over a century, I have lived in secret.",
      carddesc_1025: "A dark knight.",
      carddesc_1026: "Miaow miaow~",
      carddesc_1027: "The setting sun represents human death. I like it.",
      carddesc_1028: "Only with the determination to die can make his career shine brightly.",
      carddesc_1029: "If I am not in the state of grace, may God put me there, and if I am, may God so keep me.",
      carddesc_1030: "I came, I saw, I conquered.",
      carddesc_1031: "What would you sacrifice, for what you believe?",
      carddesc_1032: "I am the Godness of Death, what were you the god of?",
      carddesc_1033: "That there's some good in this world, and it's worth fighting for.",
      carddesc_1034: "Whosoever holds this hammer, if he be worthy, shall possess the power of Thor.",
      carddesc_1035: "Revenge of the hidden things behind, usually is more terrible than revenge.",
      carddesc_1036: "You will therefore assume the position of a suppliant before this throne.You will kneel.",
      carddesc_1037: "Life is the great indulgence\uff0cdeath is the great abstinence.",
      carddesc_1038: "Have you ever seen the sun and moon swallowed?",
      carddesc_1039: "I have fought on the battlefield all my life, but there is no good ending.",
      carddesc_1040: "Don't hate your enemy, it will affect your judgment.",
      carddesc_1041: "Do you remember? Odin, in those old days, we mixed blood together!",
      carddesc_1042: "Sword of victory! Fight!",
      carddesc_1043: "When the sword of righteousness is wielded, it is necessary to hear the cry of the evildoer!",
      carddesc_1044: "What's terrible about death? Death is redemption.",
      carddesc_1045: "Sow! I will bring you a bumper harvest!",
      carddesc_1046: "God gave me the invisible, by which I transcended myself and entered the immortal body.",
      carddesc_1047: "I let human beings no longer know death, I put blind hope in their hearts. Besides, I gave them the fire.",
      carddesc_1048: "I have been sleeping for thousands of years. Who created me?",
      carddesc_1049: "Why do people regard me as an ominous thing?",
      carddesc_1050: "Dear princess, if you kiss me, you will witness magic!",
      carddesc_1051: "WOW! How lovely the red apple is! It must be delicious. Thank you!",
      carddesc_1052: "I'll put the presents in your Christmas stockings. Merry Christmas!",
      carddesc_1053: "Phoenix Nirvana, Born of Fire!",
      carddesc_1054: "Men, if you're willing to fight for our people, I want you!",
      carddesc_1055: "May i help you\uff1f",
      carddesc_1056: "Will you join me in digging for treasure?",
      carddesc_1057: "What is the greatest invention in human history?",
      carddesc_1058: "Hooah!I am a grain of sand, blowing eastward with the wind! The wind is my master. Who is the master of the wind?",
      carddesc_1059: "If you are tolerant and see anger as an enemy, you can smooth and long term.",
      carddesc_1060: "The good or bad fate of life depends entirely on one's fate and courage.",
      carddesc_1061: "The sea of suffering is boundless,turning back is the shore.",
      carddesc_1062: "Sol!I will fight to the death with you!",
      carddesc_1063: "Mountains never tire of being high,and seas never tire of being deep.",
      carddesc_1064: "Monster! Where to run?",
      carddesc_1065: "Life is like an anvil,the more it is beaten,the more sparks can be emitted!",
      carddesc_1066: "Loki!I hate you to the extreme!",
      carddesc_1067: "Romance never dies.",
      carddesc_1068: "Have you seen the land of freedom I speak of?",
      carddesc_1069: "Who can make a better weapon than me?",
      carddesc_1070: "How broad is your heart, how far your war horse can gallop.",
      carddesc_1071: "The sweet-scented osmanthus in the Moon Palace is so fragrant!",
      carddesc_1072: "Do you perceive my presence?",
      carddesc_1073: "I can accept failure,but I can't accept giving up.",
      carddesc_1074: "Our wedding feast lasted three thousand years.",
      carddesc_1075: "Can I sing a song for you?",
      carddesc_1076: "A man who has been through bitter experiences and travelled far enjoys even his sufferings after a time.",
      carddesc_1077: "I'm not lion,I am Kylin!",
      carddesc_1078: "Always faithful to the High King Aslan!",
      carddesc_1079: "I was lying on something hard,so that I am black and blue all over my body.",
      carddesc_1080: "Sumo wrestlers make their hearts only on the ground.",
